import React , { useState } from "react";
import {
  Grid,
  CircularProgress,
  Typography,
  Button,
  TextField,
  Paper,
  Fade,
} from "@material-ui/core";
import Alert from '@material-ui/lab/Alert';
import CloseIcon from '@material-ui/icons/Close';
import IconButton from '@material-ui/core/IconButton';
import Collapse from '@material-ui/core/Collapse';
import useStyles from "./style";
import { withRouter } from "react-router-dom";
//Context
import { useUserDispatch, userRegistry } from "../../context/UserContext";
import logo from "../../assets/images/logo.png";

function Registry(props) {
var classes= useStyles();

var [isLoading, setIsLoading] = useState(false);
var [registryValue, setRegistryValue] = useState("");
var [passwordValue, setPasswordValue] = useState("");
var [answer, setAnswer] = useState(null);
var [error, setError] = useState(null);
const [open, setOpen] = React.useState(true);
  // global
  // var userDispatch = useUserDispatch();
  //render() {

   // const { showAlert } = this.state;
  return (
    <Grid container className={classes.container}>
      <Paper
        variant="elevation"
        elevation={5}
        className={classes.loginBackground}
        square= {false}
      >
        <div className={classes.formContainer}>
          <div className={classes.form}>
            <Typography variant="h1" className={classes.title}>
              Registro
            </Typography>
            <div className={classes.logotypeContainer}>
              <img src={logo} alt="logo" className={classes.logotypeImage} />
            </div>
            <TextField
              id="identification"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={registryValue}
              onChange={e => setRegistryValue(e.target.value)}
              margin="normal"
              placeholder="Número de identificación"
              label="Número de identificación"
              type="text"
              variant="outlined"
              fullWidth
            />
            <TextField
              id="name"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={registryValue}
              onChange={e => setRegistryValue(e.target.value)}
              margin="normal"
              placeholder="Nombre"
              label="Nombre"
              type="text"
              variant="outlined"
              fullWidth
            />
            <TextField
              id="lastname"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={registryValue}
              onChange={e => setRegistryValue(e.target.value)}
              margin="normal"
              placeholder="Apellidos"
              label="Apellidos"
              type="text"
              variant="outlined"
              fullWidth
            />
            <TextField
              id="email"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={registryValue}
              onChange={e => setRegistryValue(e.target.value)}
              margin="normal"
              placeholder="Correo"
              label="Correo"
              type="email"
              variant="outlined"
              fullWidth
            />
            <TextField
              id="password"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={passwordValue}
              onChange={e => setPasswordValue(e.target.value)}
              margin="normal"
              placeholder="Contraseña"
              label="Contraseña"
              type="password"
              variant="outlined"
              fullWidth
            />
            <TextField
              id="repeatpassword"
              InputProps={{
                classes: {
                  underline: classes.textFieldUnderline,
                  input: classes.textField,
                },
              }}
              value={passwordValue}
              onChange={e => setPasswordValue(e.target.value)}
              margin="normal"
              placeholder="Repetir Contraseña"
              label="Repetir Contraseña"
              type="password"
              variant="outlined"
              fullWidth
            />
            <div className={classes.formButtons}>
            {isLoading ? (
                  <CircularProgress size={26} className={classes.loginLoader} />
                ) : (
                <Button
                  disabled={
                    registryValue === '' || passwordValue === ''
                  }
                  onClick={() =>
                    userRegistry(
                      registryValue,
                      passwordValue,
                      props.history,
                      setIsLoading,
                      setError,
                      setAnswer
                    )
                  }
                  variant="contained"
                  className={classes.loginButtom}
                  color="primary"
                  size="large"
                >
                  Registrarse
                </Button>
                )}
            </div>
          </div>
        </div>

      </Paper>
      {
                  answer?(
                    <Collapse in={open}>
                          <Alert
                          severity="error"
                            action={
                              <IconButton
                                aria-label="close"
                                color="inherit"
                                size="small"
                                onClick={() => {
                                  setOpen(false);
                                }}
                              >
                                <CloseIcon fontSize="inherit" />
                              </IconButton>
                            }
                          >
                            Algó pasó verifica los datos
                          </Alert>
                          </Collapse>
                  ):
                  (
                    <Typography color="secondary" className={classes.errorMessage}>

                  </Typography>
                  )
                }
    </Grid>
  );
//}
}

export default withRouter(Registry);
